css:
.js-console {
  padding: 20px;
  font-size: 25px;
}
.js-console .code {
  opacity: 0.7;
}
.js-console .executionTime {
  opacity: .5;
  font-size: 12px;
}
.js-console .output {
  color: #06D6A0;
}
.js-console p {
  margin: 0;
}
.js-console .error {
  color: #E94F37;
}
.ajc__editor .editor {
  padding: 20px 5px;
  min-height: 300px;
}
.ajc__editor .ajc__editor__close {
  cursor: pointer;
  content: 'x';
  display: flex;
  position: absolute;
  top: 10px;
  right: 10px;
  width: 32px;
  height: 29px;
  justify-content: center;
  z-index: 100;
  color: white;
  background-color: rgba(233, 79, 55, 0.2);
  font-size: 18px;
  transition: all 300ms;
}
.ajc__editor .ajc__editor__close:hover {
  background-color: #e94f37;
}
